class Solution {
    public int canCompleteCircuit(int[] gas, int[] cost) {
        int sGas = 0, sCost = 0, total = 0, res = 0;
        for (int i = 0; i < gas.length; i++) {
            sGas += gas[i];
            sCost += cost[i];
        }
        if (sGas < sCost)
            return -1;

        for (int i = 0; i < gas.length; i++) {
            total += gas[i] - cost[i];
            if (total < 0) {
                total = 0;
                res = i + 1;
            }
        }
        return res;
    }

}

/**
 * Definition for singly-linked list.
 * public class ListNode {
 * int val;
 * ListNode next;
 * ListNode() {}
 * ListNode(int val) { this.val = val; }
 * ListNode(int val, ListNode next) { this.val = val; this.next = next; }
 * }
 */
class Solution {
    public ListNode swapPairs(ListNode head) {
        if (head == null || head.next == null) {
            return head;
        }

        ListNode dummy = new ListNode(0);
        dummy.next = head;
        ListNode prev = dummy;

        while (head != null && head.next != null) {
            ListNode first = head;
            ListNode second = head.next;

            first.next = second.next;
            second.next = first;
            prev.next = second;

            prev = first;
            head = first.next;
        }
        return dummy.next;
    }
}

class Solution {
    public int trap(int[] height) {
       int len = height.length;
       int [] left = new int[len];
       int [] right = new int[len];
       int prevMax = height[0];
       int water = 0;
       for(int i = 0; i<len;i++){
            left[i] = Math.max(prevMax,height[i]);
            if(height[i]>prevMax)
            prevMax = height[i];
       }

       prevMax = height[len-1];
       for(int i = len-1;i>=0;i--){
        right[i]=Math.max(prevMax,height[i]);
       if(height[i]>prevMax)
            prevMax = height[i];
       }

       for(int i= 0;i<len;i++){
        int min = Math.min(left[i],right[i]);
        water += min-height[i];
       }
       return water;
    }
}

class Solution {
    public List<List<Integer>> threeSum(int[] nums) {
        int len = nums.length;

        Set<List<Integer>> resultSet = new HashSet<>();
        Arrays.sort(nums);
         for (int i = 0; i < len; i++) {
            int target = -nums[i];
            int low = i+1, high = len - 1;
            while(low<high){
               int sum = nums[low]+nums[high];
                if(sum==target){
                    resultSet.add(Arrays.asList(nums[i],nums[low],nums[high]));
                    low++;
                    high--;
                }
                else if(sum>target)
                high--;
                else
                low++;
            }
        }
        List<List<Integer>> resultList = new ArrayList<>(resultSet);
        return resultList;
    }
}

